import React from "react";


class Content extends React.Component   {
    async contentCall() {
      const response = request.get("http://localhost:8000/");  

      fetch("http://localhost:8000/")
          .then(response => {
            if (!response.ok) {
              throw new Error('Network response was not ok');
            }
            return response.json();
          })
          .then(data => {
            // Burada data kullanılmalı, örneğin:
            console.log(data);
          })
          .catch(error => {
            console.error('Fetch error:', error);
          });
      }
    async render(){
        var content = this.contentCall();
        return(
            <div>hello
              {console.log(content)}
            </div>


        );
    }
}






export default Content;
